_id\n      table-underline: true\n      logic-delete-value: 1\n      logic-not-delete-value: 0\n  configuration:\n    map-underscore-to-camel-case: true\n\n\n# spring security 配置\nsecurity:\n  oauth2:\n    resource:\n      loadBalanced: true\n      token-info-uri: http://cognition-auth/oauth/check_token\n    # 通用放行URL，服务个性化，请在对应配置文件覆盖\n    ignore:\n      urls:\n        - /v2/api-docs\n        - /actuator/**\n# swagger 配置\nswagger:\n  title: 和家训练API\n  license: Powered By hj\n  licenseUrl: https://hj.com\n  terms-of-service-url: https://hj.com\n  host: https://rzcs.yj-health.com/dev/api\n  contact:\n    email: hj@gmail.com\n    url: https://hj.com\n  authorization:\n    name: hj OAuth\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: server all\n    token-url-list:\n      - http://${GATEWAY_HOST:cognition-gateway}:${GATEWAY-PORT:9999}/auth/oauth/token\nknife4j:\n  enable: true\n\ncognition:\n  enableLocalAuth: true\n  localCacheTime: 600\n  #给手机验证码登录用\n  defaultOrgId: 100\ncacheConfig:\n  default: 2000,20m\n  other_user_data: 2000,10000s\ntencent: \n  sdkAppId: 1400695031\n  secretKey: 36edab3980fe57144048aa81b0cc5bc0378c51ee4f272f2ff41b42690733ab62\n  tenCentUserId: administrator','5935e35c2e713a551137895077eb0a97','2022-01-05 10:06:12','2024-04-18 16:04:07',NULL,'10.0.0.2','','','公共yml','','','yaml','',NULL),(318,'db-config.yml','DEFAULT_GROUP','spring:\n  datasource:  # 数据源配置\n    druid:\n      initialSize: 5    # 初始化大小\n      minIdle: 5        # 最小\n      maxActive: 20     # 最大\n      maxWait: 60000    # 获取连接等待超时的时间\n      timeBetweenEvictionRunsMillis: 60000    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n      minEvictableIdleTimeMillis: 300000      # 配置一个连接在池中最小生存的时间，单位是毫秒\n      validationQuery: SELECT 1 FROM DUAL\n      keepAlive: true\n      testWhileIdle: true\n      testOnBorrow: false\n      testOnReturn: false\n      poolPreparedStatements: true                    # 打开PSCache\n      maxPoolPreparedStatementPerConnec