-biz\n          uri: lb://cognition-train-biz\n          predicates:\n            - Path=/cognition/**\n         # 快筛模块\n        - id: cognition-screening-biz\n          uri: lb://cognition-screening-biz\n          predicates:\n            - Path=/screening/**\n         # 心理量表模块\n        - id: cognition-mind-biz\n          uri: lb://cognition-mind-biz\n          predicates:\n            - Path=/mind/**    \n        # Demo模块\n        - id: ct-demo-biz\n          uri: lb://ct-demo-biz\n          predicates:\n            - Path=/ct/**\n        #第三方用户 模块\n        - id: cognition-otheru-biz\n          uri: lb://cognition-otheru-biz\n          predicates:\n            - Path=/otheru/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #第三方用户 模块\n        - id: cognition-sort-biz\n          uri: lb://cognition-sort-biz\n          predicates:\n            - Path=/sort/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #京师服务\n        - id: cognition-js-biz\n          uri: lb://cognition-js-biz\n          predicates:\n            - Path=/js/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #训练仪对接服务\n        - id: cognition-device-biz\n          uri: lb://cognition-device-biz\n          predicates:\n            - Path=/device/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #眼动视频解析服务\n        - id: cognition-eyetrack-biz\n          uri: lb://cognition-eyetrack-biz\n          predicates:\n            - Path=/eyetrack/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200     \ngateway:\n  encode-key: \'thanks,pig4cloud\'\n  ignore-clients:\n    - test\n    - demo\n    - pig\n    \n\nswagger:\n  ignore-providers:\n    - cognition-auth\n    - cognition-codegen\n\n','d689b70cb606ecaf8d2ccf84b9b7e3b2','2022-01-05 10:47:16','2024-05-16 14:07:15',NULL,'10.0.0.2','','','cognition-gateway.yml','','','yaml','',NULL),(332,'cognition-upms-biz.yml','DEFAULT_GROUP','security:\n  oauth2:\n    client:\n      client-id: ENC(imENTO7M8bLO38LFSIxnzw==)\n      client-secret: ENC(i3cDFhs26sa2Ucrfz2hnQw==)\n      scope: server\n\n# 数据源\nspring:\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: ENC(pcJmJSV69YJ4otjgUG2MPw==)\n    url: jdbc:mysql://cognition-mysql:33061/cognition?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&allowMultiQueries=true&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=Asia/Shanghai\n    druid:\n      filters: stat\n','80ab3c21089660a39ddfea548eb15007','2022-01-05 10:51:21','2024-03-21 10:32:38',NULL,'10.0.0.3','','','cognition-upms-biz.yml','','','yaml','',NULL),(334,'cognition-otheru-biz.yml','DEFAULT_GROUP','spring:\n  datasource:  # 数据源配置\n    #type: com.alibaba.druid.pool.DruidDataSource\n    #driver-class-name: com.mysql.cj.jdbc.Driver\n    #username: